  const { data } = props;
  console.log(data);
  //confirmed
  //recovered
  //deaths
  //lastUpdate
  if (!data) {
    return "loadin........";
  }
  return (
    <div className="container">
      <Grid container spacing={3} justify="center">
        <Grid item component={Card}>
          <CardContent>
            <Typography colour="textSecondary">infected</Typography>
            <Typography variant="h5">confirmed cases</Typography>
